import React from 'react';
import './App.css';
import Game_grid from './components/Game_grid';

function App() {


  return (

    <div className="grid-container">
      <header className="header">
        <div> <button type="button" className="button">Reset</button></div>
        <div>Snake and ladder Game</div>
        <div> <button type="button" className="button">Start</button></div>
      </header>

      <main className="main">
        <Game_grid />
      </main>

      <footer className="footer">
        <div> Please Select Color box</div>
      </footer>
    </div>

  );
}

export default App;
